description:
Have to go to your uncle's boring wedding? Unwanted family reunion? Have you found yourself alone again at lunch time and looking for something to spend your time on? Look no further! 

Play through 6 exciting musical levels in this new fast-paced arcade. Each level contains a different song and you can watch the background as it syncs with the music! Play on your phone and tablet with only one purchase!

Gameplay - Tri-angle is all about fast gameplay, catchy melodies, and beautiful visuals.
Universal - Pay once and play on all your devices. No In-App purchases!

